import { Component } from "./Component";
import { useGlobalContext } from "./context";
const AllComponents = () => {
  const { addCol, state } = useGlobalContext();
  return (
    <div>
      {state.coloumns.map((item, index) => {
        if (item != "") {
          return <Component name={item} key={index} />;
        }
      })}

      <form
        onSubmit={(e) => {
          e.preventDefault();
          addCol(e.target.input.value);
        }}
      >
        <label>Add Coloumn:</label>
        <input name="input" type="text" />
        <button type="submit">Add</button>
      </form>
    </div>
  );
};

export default AllComponents;
